"use strict";(self.webpackChunkalpha_club=self.webpackChunkalpha_club||[]).push([[386],{581:function(e,t,o){o.r(t);var i=o(152),n=o(791),r=o(184);t.default=function(){var e=(0,n.useState)(0),t=(0,i.Z)(e,2),o=t[0],a=t[1];return(0,r.jsx)("section",{id:"faqs",className:"section-row-inner section--faq",children:(0,r.jsx)("div",{className:"main__container--fluid",children:(0,r.jsxs)("div",{className:"main__container",children:[(0,r.jsx)("h1",{className:"section-heading aos-init","data-aos":"fade",children:(0,r.jsx)("span",{children:"Frequently Asked Questions"})}),(0,r.jsx)("div",{className:"faq__wrap",children:(0,r.jsx)("div",{className:"faq__box",children:(0,r.jsx)("div",{className:"accordion",children:[{title:"How many NFT\u2019s are there?",content:"<p>There will be 7,777 total NFT\u2019s minted.</p>"},{title:"Are there different tiers of the NFT collection?",content:"<p>Yes, there are 4 different levels of membership.</p>\n                <p>Bronze \u2013 Membership, access to the community. Opportunity to upgrade to a Silver token through participation and contribution. Automatically get whitelisted for future projects.</p>\n                <p>6000 tokens</p>\n                <p>Silver \u2013 100% of book profit share, plus get listed in credits.</p>\n                <p>1500 tokens</p>\n                <p>Gold \u2013 sponsorship, featured in book as an influencer/artist/creator to follow 1 ETH</p>\n                <p>250 tokens</p>\n                <p>Platinum \u2013 dedicated chapter in book. Advisor role. By invitation only.</p>\n                <p>27 tokens (or voted on by community)</p>"},{title:"What do I get for owning each tier of the NFT?",content:"<p><strong>Bronze \u2013</strong> The Bronze tier is the entry level token into the Alpha Book Club. It gives you access to the private server where all the exclusive games, contests and giveaways take place. It also serves as the Genesis token, granting you automatic whitelisting for all future book projects.</p>\n                <p><strong>Silver \u2013</strong> Silver tokens are not part of the initial mint but will only be granted as a reward for participating and contributing to the book. Because not everyone will actively participate in the creation of the book, it\u2019s only fair that those who contribute will be rewarded with the spoils. Therefore, 100% of the book profits will be split between Silver token holders.</p>\n                <p><strong>Gold \u2013</strong> Gold tokens are reserved for Sponsors only and will not be part of the initial mint. Sponsors will be featured throughout the book, on the website and in our promotions. Gold token holders will also get access to our private Advisor channel inside the Discord.</p>\n                <p><strong>Platinum \u2013</strong> Platinum tokens are reserved for Advisors only and are not part of the initial mint. Advisors will each get a dedicated chapter in the book, featuring their project or artwork, and a chance to tell their story.</p>"},{title:"Who is writing the book?",content:"<p>WAGWI \u2013 We All Gonna Write It</p>\n                <p>The NFT Community will come together to name the book, choose the Table of Contents, name each chapter, write, edit and promote the book. This will truly be a community effort.</p>\n                <p>But we have also partnered with a 19x NYT Best-Selling Book Publisher who loves this project and will support and serve us from start to finish to ensure this project is a smashing success.</p>"},{title:"How will the project be organized?",content:"<p>With the initial mint, everyone will receive a bronze token. The bronze token is our genesis token and gives you membership access to the private discord server where all the magic happens.</p>\n                <p>Games, contests and giveaways will be the mechanisms by which the work will be accomplished by the community. There will be art contests, writing contests, promotional contests, giveaways and partnerships that will ultimately produce the work we submit to our publishing agency. The publishing agency will then take our rough draft, and turn it into a NYT best seller.</p>\n                <p>Through these games, contests and giveaways participants will be rewarded with an upgraded silver token. Silver token holders will be rewarded with 100% of the profit share of the book. Silver tokens cannot be minted but must be won through participation and contribution to the project. There will be contests and giveaways throughout the project, allowing for community members to upgrade their positions. This will not only encourage engagement but also help produce the best finished product possible.</p>\n                <p>*We will keep a certain number of bronze, silver and gold tokens back to reward the community based on their participation and value they add to the project.</p>"},{title:"When will the book be published?",content:"<p>This will be determined after I speak with JeVon.</p>"},{title:"Profit share breakdown",content:"<p>100% of book profits will be distributed back to the community.</p>\n                <p>Bronze \u2013 We realize not everyone will participate in the planning, editing, and writing of the book. Which is why we want to setup a system that rewards those who do contribute.</p>\n                <p>As such, Silver tokens will be awarded to everyone that participates.</p>"},{title:"Book as NFT?",content:"<p>Jenkins says that he\u2019s dropping the book as an NFT and all holders will get a copy airdropped. Not sure the mechanics of how this would work, but it\u2019s definitely an option.</p>"},{title:"When is the official launch?",content:"<p>TBD</p>"},{title:"What will the mint price be?",content:"<p>.07</p>"},{title:"Who is this project for?",content:"<p>This project is for writers, artists, creators, builders, marketers, disrupters, revolutionaries and the defenders of web3. This project is for those who want to write the history books, shape the future and play an active role in the direction of the NFT space.</p>"},{title:"How does the raffle work?",content:"<p></p>"},{title:"How do I get a free 2nd NFT?",content:"<p></p>"},{title:"How can I use my NFT?",content:"<p></p>"},{title:"What makes this NFT special?",content:"<p></p>"}].map((function(e,t){return(0,r.jsxs)("div",{className:"accordion__box ".concat(t===o?"active":""," aos-init"),"data-aos":"fade-in",children:[(0,r.jsx)("div",{className:"accordion__head",onClick:function(){var e;a((e=t)!==o?e:null)},children:(0,r.jsx)("span",{children:e.title})}),(0,r.jsx)("div",{className:"accordion__body",children:(0,r.jsx)("div",{className:"faqs-list",dangerouslySetInnerHTML:{__html:e.content}})})]},t)}))})})})]})})})}}}]);
